  input: TEXT,F3A,,"Some itemized contributions may be from donors for whom we do
    not have occupation/employer information.  We have made efforts to gain this information
    throughout the solicitation process.  First, our initial pledge/fundraising letter
    requests that contributions include occupation/employer information for FEC purposes.  Second,
    when we receive a contribution without occupation info we call the donor to request
    the information.  Third, a volunteer and I called all donors for whom we don't
    have occupation info.  In a few cases we left messages which have not been returned.  We
    are continuing our efforts to track down this information.  -ME"
